import React from "react";
import './contact.css';
import walmart from '../../assets/walmart.png';
import Adobe from '../../assets/adobe.png';
import microsoft from '../../assets/microsoft.png';
import facebook from '../../assets/facebook.png';
function Contact(){
    return(
        <section id="contactPage">
            <div className="clients">
                <h1 className="contactPageTitle">My Clients</h1>
                <p className="clientDesc">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nulla incidunt neque harum accusantium, itaque, laborum veritatis voluptatibus aliquid exercitationem a dignissimos nesciunt tenetur fugit in eveniet officiis libero velit voluptates!</p>
                <div className="clientImgs">
                    <img src="" alt="" className="clientImg" />
                </div>
            </div>
            <div id="contact">

            </div>
            <h2 className="contactTitle">Contact Me</h2>
            <p className="contactDesc">Lorem ipsum dolor sit, amet consectetur adipisicing elit. Esse eius tempore aut, rem suscipit, animi dicta fugit amet veritatis, asperiores perspiciatis! Laudantium reprehenderit, explicabo cupiditate similique animi consectetur velit magnam voluptatibus provident sapiente optio!</p>
        </section>

    )
}
export default Contact;
